import React from "react";

const Login = () => {
    const rappers = ['Travis Scott', 'Lil Uzi Vert', 'Playboi Carti', 'Gunna'];

    return (
        <div>
            <h1> Login Form </h1>
            {rappers.map(item => {item})}
        </div>
    );
};

export default Login;
